import{_ as e,c as o,o as t,a2 as a}from"./chunks/framework.CEgrwLex.js";const f=JSON.parse('{"title":"SYSYZ-ITCOM","description":"","frontmatter":{},"headers":[],"relativePath":"guide/about.md","filePath":"guide/about.md"}'),i={name:"guide/about.md"},r=a('<h1 id="sysyz-itcom" tabindex="-1">SYSYZ-ITCOM <a class="header-anchor" href="#sysyz-itcom" aria-label="Permalink to &quot;SYSYZ-ITCOM&quot;">​</a></h1><p>Hello！这里是邵阳市第一中学信息技术社团，于 2024 年 1 月 6 日由邵阳市第一中学在校学生创立，旨在宣传计算机技术和聚集志同道合的人互相交流、切磋，解决问题、传授知识，在一个其乐融融的氛围中提升自己的技术能力并扩宽自身的眼界。</p><p>Hello！ Founded on January 6, 2024 by students of Shaoyang No. 1 Middle School, the Information Technology Club of Shaoyang No. 1 Middle School aims to promote computer technology and gather like-minded people to communicate with each other, learn from each other, solve problems, impart knowledge, improve their technical skills and broaden their horizons in a happy atmosphere.</p><h2 id="社交媒体-social-media" tabindex="-1">社交媒体（Social media） <a class="header-anchor" href="#社交媒体-social-media" aria-label="Permalink to &quot;社交媒体（Social media）&quot;">​</a></h2><p>如果您想深入了解我们，可以通过以下方式阅览，我们会在下列工作账号中发布我们的对信息技术和其他事情的见解。</p><p>If you&#39;d like to learn more about us, you can do so in the following ways, and we&#39;ll post our insights on information technology and other things in the work accounts below.</p><ul><li><a href="https://b23.tv/yFKX8Fy" target="_blank" rel="noreferrer">哔哩哔哩（BiliBili）</a></li></ul><h2 id="联系我们-contact" tabindex="-1">联系我们（Contact） <a class="header-anchor" href="#联系我们-contact" aria-label="Permalink to &quot;联系我们（Contact）&quot;">​</a></h2><p>如果您对我们的社团有疑问，请通过以下方式与我们取得联系。</p><p>If you have questions about our community, please contact us using the following methods.</p><ul><li><a href="mailto:sysyzitcom@163.com" target="_blank" rel="noreferrer">工作邮箱（Email）</a></li><li>微信公众号（WeChat public account）：sysyzitcom</li></ul><div class="note custom-block github-alert"><p class="custom-block-title">NOTE</p><p>您好！我们的工作人员大部分为在校学生，您向我们发送的邮件或者文字信息可能无法及时收到回复。对于您向我们发送的邮件或者文字信息，我们会尽量在 48 小时内受理，感谢您的理解。 Hello! Most of our staff are current students, and you may not receive a response to your email or text message to us in a timely manner. We will try our best to accept the email or text message you send to us within 48 hours, thank you for your understanding.</p></div><h2 id="交流社群-communicate" tabindex="-1">交流社群（Communicate） <a class="header-anchor" href="#交流社群-communicate" aria-label="Permalink to &quot;交流社群（Communicate）&quot;">​</a></h2><p>如果您想与我们共同探讨有关信息技术方面的问题、交流前沿科技或者进行学术交流，请您使用 QQ 添加我们的社群：<a href="https://qm.qq.com/q/3o0uwFr8o8" target="_blank" rel="noreferrer">827566599</a></p><p>If you want to discuss issues related to information technology, exchange cutting-edge technologies or have academic exchanges with us, please use QQ to add to our community:<a href="https://qm.qq.com/q/3o0uwFr8o8" target="_blank" rel="noreferrer">827566599</a></p><div class="note custom-block github-alert"><p class="custom-block-title">NOTE</p><p>入群后，请向我们描述您的来意，并遵守群聊相关规定，感谢！（After joining the group, please describe your intention to us and abide by the relevant rules of the group chat, thank you!）</p></div>',16),n=[r];function l(s,c,u,h,d,m){return t(),o("div",null,n)}const y=e(i,[["render",l]]);export{f as __pageData,y as default};
